    constructor(props){
        super(props);
        this.state = {
            resume : false
        }
    }

    render() {
        return (
        <div id="banner">
            <h1>Kasa</h1>
            <a href="">Accueil</a>
            <a href="">A Propos</a>
        </div>
        )
    }
}
